import React from 'react';

const Cards = (props) => {
    const {country} = props;
    return (
        <li className="card">
        <img src="" alt="flag"/>
        <div className="data-container">
        <ul>
        <li>{country["common"]}</li>
        <li>{country.name}</li>
        <li>{country.name}</li>

        </ul>

        </div>
        </li>
    );
};

export default Cards;
